Episode Title: &quot;Rehab Brother; Fire Hydrant Slam!&quot;
Episode Order: Season 18, Episode 192
Original Air Date: April 10, 2014

&quot;A man says he voluntarily stayed in rehab an extra nine months and denies owing his brother for bills paid while he was away; after crashing her friend's car, a woman tries to blame the friend for having distracting things hanging from the mirror.&quot;

Seed and enjoy!
